    static GraphQLQuery()
    {
      List<City> cities = _cities;
      List<District> districts = _districts;
      for (int i = 0; i < cities.Count; i++)
      {
        City city = cities[i];
        city.Districts = districts.Where(q => q.IdCity == city.Id).ToList();
      }
    }

    public GraphQLQuery(AdminDbContext context)
    {
      _context = context;
    }

    public City GetCity(string code)
    {
      City result = _cities.FirstOrDefault(c => c.Code == code);
      return result;
    }

    public async Task<List<District>> GetVillages(string cityCode)
    {
      await Task.Delay(20000);
      City result = _cities.FirstOrDefault(c => c.Code == cityCode);
      if (result == null)
        await Task.FromResult(new List<District>());
      return await Task.FromResult(_districts.Where(q => q.IdCity == result.Id).ToList());
    }

    public async IAsyncEnumerable<District> GetAllVillages()
    {
      foreach (var village in _districts)
      {
        // Trả về từng village ngay khi có sẵn
        yield return village;
        await Task.Delay(1000);  // Giả lập độ trễ cho từng village
      }
    }

    public IQueryable<City> GetCity()
    {
      return _cities.AsQueryable();
    }

    public IQueryable<City> GetCity2()
    {
      return _cities.Skip(2).AsQueryable();
    }
  }
